import React, { useState } from "react";

const Count = () => {
  const [count, setcount] = useState(0);

  const IncNum = () => {
    return setcount(count + 1);
  };
  const DecNum = () => {
    return setcount(count - 1);
  };
  return (
    <>
      <h1 className="slot-inner">{count}</h1>
      <button onClick={IncNum} className="slot-inner">
        {" "}
        +{" "}
      </button>{" "}
      <button onClick={DecNum} className="slot-inner">
        {" "}
        -{" "}
      </button>
    </>
  );
};

export default Count;
